import def from 'ajv/dist/vocabularies/discriminator';
import React from 'react';

function Home() {
  return (
    <>
      <div style={{ textAlign: 'center', marginTop: '50px', color: 'red' }}>
        <h1>Welcome to OSRS Challenge Hub</h1>
        <p style={{ color: 'rgba(250, 106, 3, 1)' }}>This is the home page.</p>
      </div>

      <div className='InfoBar'>
        <p>
          Welcome to the OSRS Challenge hub where you can play different challenges with your mates or by yourself!
          <br /><br />
          The web page is still a work in progress and new game modes are coming and more options will be added soon.
          <br /><br />
          This web page is created by VALTEE for a portfolio project and come on... it's just fun to have minigames in OSRS!
        </p>
      </div>
    </>
  );
}
